// src/index.ts
var import_jsoneditor = __toESM(require_jsoneditor_min(), 1);
var getDateString = () => {
  const now = new Date;
  const dateString = now.getFullYear().toString() + "-" + (now.getMonth() + 1).toString().padStart(2, "0") + "-" + now.getDate().toString().padStart(2, "0");
  return dateString;
};
var editorModes = ["code", "form", "text", "view", "tree", "preview"];
var openUrl = (schemaID) => `https://forms.protronic-gmbh.de/form-gen/prot-form-gen.html?schema=${schemaID}&lsid=null`;
var queryUrl = "https://database.protronic-gmbh.de/query?database=formly";
var getSchemasQuery = `SELECT _id, CASE WHEN JSON_VALUE([log], '$."formular"') IS NULL THEN JSON_VALUE([log], '$."name"') ELSE JSON_VALUE([log], '$."formular"') END AS formular, JSON_VALUE([log], '$."date"') AS [date], log FROM schemas;`;
var newSchemaQuery = (formular) => `INSERT INTO schemas (log) VALUES ('{"formular": "${formular}", "date": "${getDateString()}"}');`;
var updateSchemaQuery = (id, schema) => `UPDATE schemas SET log = '${schema}' WHERE _id = ${id};`;
var selectedSchema = undefined;

class AuswahlElement extends HTMLElement {
  elements = {};
  listItems = [];
  onClickHandler(schema, li) {
    this.listItems.forEach((value) => value.classList.remove("marked"));
    li.classList.add("marked");
    let editor = document.querySelector("editor-element");
    selectedSchema = schema;
    if (editor instanceof EditorElement) {
      editor.setJson(schema.log);
    }
  }
  createListElement() {
    let ul = document.createElement("ul");
    ul.classList.add("schema-list");
    this.appendChild(ul);
    this.elements.listElement = ul;
  }
  createListItemColumnCell(key, schema, li) {
    let secKey = key.toString();
    if (secKey == "_id" || secKey == "formular" || secKey == "date") {
      let div = document.createElement("div");
      div.classList.add(key.toString(), "schema");
      div.innerText = schema[secKey].toString();
      li.appendChild(div);
    }
  }
  createListItem(schema) {
    let li = document.createElement("li");
    li.classList.add("schema");
    if (schema._id == selectedSchema?._id)
      li.classList.add("marked");
    Reflect.ownKeys(schema).forEach((key) => {
      this.createListItemColumnCell(key.toString(), schema, li);
    });
    li.addEventListener("click", this.onClickHandler.bind(this, schema, li));
    this.listItems.push(li);
    this.elements.listElement.appendChild(li);
  }
  async fetchList() {
    let schemaList = await fetch(queryUrl, {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ query: getSchemasQuery })
    }).then((response) => response.json());
    this.createListElement();
    schemaList.forEach((schema) => {
      delete schema["ROWSTAT"];
      this.createListItem(schema);
    });
    console.log(schemaList);
  }
  removeElements() {
    console.log(this);
    console.log(this.elements.listElement);
    this.elements.listElement.remove();
    delete this.elements.listElement;
    this.listItems = [];
  }
  async refresh() {
    this.removeElements();
    await this.fetchList();
  }
  async connectedCallback() {
    await this.fetchList();
  }
}

class EditorElement extends HTMLElement {
  editor;
  elements = {};
  onChangeListener() {
    let selected = this.elements.dropdown.selectedOptions[0].value;
    this.changeMode(selected);
    let menu = this.querySelector(".jsoneditor-menu");
    if (menu)
      menu.prepend(this.elements.dropdown);
  }
  createModeDropdown(div) {
    let menu = div.querySelector(".jsoneditor-menu");
    if (menu) {
      this.elements.dropdown = document.createElement("select");
      this.elements.dropdown.append(...editorModes.map((mode) => {
        let option = document.createElement("option");
        option.value = mode;
        option.text = mode;
        return option;
      }));
      this.elements.dropdown.addEventListener("change", this.onChangeListener.bind(this));
      menu.prepend(this.elements.dropdown);
    }
  }
  createEditor() {
    const div = document.createElement("div");
    this.editor = new import_jsoneditor.default(div, { mode: "code" });
    this.createModeDropdown(div);
    this.appendChild(div);
  }
  setJson(json) {
    if (this.editor) {
      json = json.split("&#39;").join("'");
      this.editor.set(JSON.parse(json));
    }
  }
  getJson() {
    if (this.editor) {
      let json = this.editor.get();
      return json;
    }
  }
  changeMode(newMode) {
    if (this.editor) {
      this.editor.setMode(newMode);
    }
  }
  connectedCallback() {
    this.createEditor();
  }
}
async function refreshAuswahlElement() {
  let auswahlElement = document.querySelector("auswahl-element");
  if (auswahlElement)
    await auswahlElement.refresh();
}

class ControlButtons extends HTMLElement {
  async handleNewBtnClick() {
    const formular = prompt("Enter a name for the schema!");
    if (formular) {
      await fetch(queryUrl, {
        method: "post",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ query: newSchemaQuery(formular) })
      });
      await refreshAuswahlElement();
    }
  }
  async handleUpdateBtnClick() {
    let editorElement = document.querySelector("editor-element");
    if (editorElement && selectedSchema) {
      let jsonObject = editorElement.getJson();
      jsonObject.date = getDateString();
      let json = JSON.stringify(jsonObject);
      json = json.split("'").join("&#39;");
      console.log(json);
      await fetch(queryUrl, {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ query: updateSchemaQuery(selectedSchema._id, json) })
      });
      await refreshAuswahlElement();
    }
  }
  async handleRemoveBtnClick() {
    alert("not implemented yet.");
  }
  async handleOpenBtnClick() {
    if (selectedSchema)
      window.open(openUrl(selectedSchema._id), "_blank");
  }
  async handleRefreshBtnClick() {
    let auswahlElement = document.querySelector("auswahl-element");
    if (auswahlElement)
      await auswahlElement.refresh();
  }
  createGenericButton(label, clickEventHandler) {
    let btn = document.createElement("button");
    btn.textContent = label;
    btn.type = "button";
    btn.addEventListener("click", clickEventHandler);
    this.append(btn);
  }
  connectedCallback() {
    this.createGenericButton("new", this.handleNewBtnClick);
    this.createGenericButton("update", this.handleUpdateBtnClick);
    this.createGenericButton("remove", this.handleRemoveBtnClick);
    this.createGenericButton("open", this.handleOpenBtnClick);
    this.createGenericButton("refresh", this.handleRefreshBtnClick);
  }
}
customElements.define("auswahl-element", AuswahlElement);
customElements.define("editor-element", EditorElement);
customElements.define("control-buttons", ControlButtons);
console.log("element registered");
